INSERT INTO `b_thing` VALUES (101, '测试水果333', '2f459c21-444e-44d7-90f1-6483c63cd08f.jpeg', '农业生产出来的各种农作物、畜禽、水产品以及与农业生产相关的产品。农产品是人类生活中必不可少的食物来源，同时也作为原材料用于食品加工、医药、化工、纺织等领域。以下是一些常见的农产品简介：\r\n\r\n农作物：包括谷物（如稻谷、小麦、玉米）、豆类（大豆、黄豆、绿豆）、蔬菜（西红柿、黄瓜、胡萝卜）、水果（苹果、香蕉、橙子）、瓜果（西瓜、哈密瓜）等。这些作物提供了人们所需的主要食物和营养素。\r\n\r\n畜禽：包括家畜（牛、猪、羊、马）和家禽（鸡、鸭、鹅、鸽子）。畜禽产品提供了人们所需的动物蛋白和其他营养物质。\r\n\r\n水产品：包括各种海产品（鱼、虾、蟹、贝类）和淡水产品（鱼、虾、蟹）。水产品是人们饮食中重要的蛋白来源。\r\n\r\n其他农产品：还包括蜂蜜、蜂蜜制品、蜂蜡、林产品（木材、竹材）、药材、茶叶、花卉等。\r\n\r\n农产品在全球各地被广泛生产和消费，对人类生活产生着重要影响。因此，农业生产和农产品市场也是国民经济的重要组成部分。为确保农产品的质量和安全，一些国家和地区还制定了相关的农产品质量标准和监管政策。', '33', '0', 0, '广西2号', '五年', '2025年1月2日', 234, '1716540269213', 3, 2, 0, 0, 0, 3, NULL);
